package com.rogelio.core.data.mappers

import com.rogelio.core.data.models.response.UsersResponseModelFields
import com.rogelio.core.domain.mappers.MapperTransform
import com.rogelio.core.domain.models.UsersDTO
import com.rogelio.core.domain.models.UsersDataDTO
import com.rogelio.core.domain.models.UsersFieldsDTO

class UsersListMapper : MapperTransform<List<UsersResponseModelFields>, UsersDTO> {

    private val emptyField = "N/I"
    private val notFoundImage = "data:image/webp;base64,"

    override fun transform(entryData: List<UsersResponseModelFields>?): UsersDTO {
        val usersDto = UsersDTO()
        entryData?.forEach { data ->
            var imageValue = ""
            var calle = ""
            var numero = ""
            var colonia = ""
            var delegacion = ""
            var estado = ""
            var cp = ""
            if (data.datos?.imagen == null || data.datos?.imagen.toString().isEmpty()){
                imageValue = notFoundImage
            } else {
                imageValue = data.datos?.imagen.toString()
            }
            if(data.datos?.calle == null || data.datos?.calle.toString().isEmpty()){
                calle = emptyField
            } else {
                calle = data.datos?.calle.toString()
            }
            if(data.datos?.numero == null || data.datos?.numero.toString().isEmpty()){
                numero = emptyField
            } else {
                numero = data.datos?.numero.toString()
            }
            if(data.datos?.colonia == null || data.datos?.colonia.toString().isEmpty()){
                colonia = emptyField
            } else {
                colonia = data.datos?.colonia.toString()
            }
            if(data.datos?.delegacion == null || data.datos?.delegacion.toString().isEmpty()){
                delegacion = emptyField
            } else {
                delegacion = data.datos?.delegacion.toString()
            }
            if(data.datos?.estado == null || data.datos?.estado.toString().isEmpty()){
                estado = emptyField
            } else {
                estado = data.datos?.estado.toString()
            }
            if(data.datos?.cp == null || data.datos?.cp.toString().isEmpty()){
                cp = emptyField
            } else {
                cp = data.datos?.cp.toString()
            }
            usersDto.Users.add(
                UsersFieldsDTO(
                    id = data.id,
                    nombre = data.nombre ?: emptyField,
                    apellidoPaterno = data.apellidoPaterno ?: emptyField,
                    apellidoMaterno = data.apellidoMaterno ?: emptyField,
                    edad = data.edad ?: 0,
                    email = data.email ?: emptyField,
                    fechaNac = data.fechaNac ?: emptyField,
                    datos = UsersDataDTO(
                        calle = calle,
                        numero = numero,
                        colonia = colonia,
                        delegacion = delegacion,
                        estado = estado,
                        cp = cp,
                        imagen = imageValue,
                    ),
                ),
            )
        }
        return usersDto
    }
}
